import React from "react";
import styled from "styled-components";

export const Container = styled.div`
  background-color: white;
  padding-top: 23px;
`;

const TrHead = styled.div`
  width: 1072px;
  height: 54px;
  padding: 16px 60px 16px 32px;
  border-radius: 3px;
  background-color: #fafafa;
`;

const ThHead = styled.th`
margin: 0 30px;

`;
const TransactionLog = () => {
  return (
    <Container>
      <TrHead>
        <tr>
          <ThHead>Date/Time</ThHead>
          <ThHead>Name</ThHead>
          <ThHead>Device</ThHead>
          <ThHead>Paryment</ThHead>
          <ThHead>BIN Number</ThHead>
          <ThHead>Amount</ThHead>
          <ThHead>Trans ID</ThHead>
          <ThHead>Decision</ThHead>
        </tr>
      </TrHead>
      <tr>
        <td>Alfreds Futterkiste</td>
        <td>Maria Anders</td>
        <td>Germany</td>
      </tr>
    </Container>
  );
};

export default TransactionLog;
